import { Container, Row, Col, Placeholder } from 'react-bootstrap';
import halfbyte from "../works/halfbyte.png";
import upcancer from "../works/upcancer.png";
import likeex from "../works/likeex.jpg";
import { Gallery } from "react-grid-gallery";

export default function Work() {
    const images = [
        {
            src: "https://c2.staticflickr.com/9/8817/28973449265_07e3aa5d2e_b.jpg",
            width: 320,
            height: 174,
            isSelected: true,
            caption: "After Rain (Jeshu John - designerspics.com)",
        },
        {
            src: "https://c2.staticflickr.com/9/8356/28897120681_3b2c0f43e0_b.jpg",
            width: 320,
            height: 212,
            tags: [
                { value: "Ocean", title: "Ocean" },
                { value: "People", title: "People" },
            ],
            alt: "Boats (Jeshu John - designerspics.com)",
        },

        {
            src: "https://c4.staticflickr.com/9/8887/28897124891_98c4fdd82b_b.jpg",
            width: 320,
            height: 212,
        },
    ];
    return (
        <Container class="wrapper" >
            <Row className='galleryP'>
                <h1 className='mb-3'>/other</h1>
                <div class="wrapper">
                    <div class="media">
                        <div class="layer">
                            <p>+ UI/UX Design</p>
                        </div>
                        <img src={likeex} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ UX Research</p>
                        </div>
                        <img src={upcancer} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ Game Development</p>
                        </div>
                        <img src={halfbyte} alt="" />
                    </div>
                </div>
            </Row>
            <Gallery images={images} />
        </Container >
    )
}
